import React from "react";
import { Route, Routes } from "react-router-dom";
import { Login, NotFound, Registration } from "../index.js";

import { SneakersRoutes } from "./Sneakers.jsx";

export const Router = () => {
  return (
    <>
      <Routes>
        <Route path="/sneakers" element={<SneakersRoutes />} />
        <Route path="/auth">
          <Route path="login" element={<Login />} />
          <Route path="registration" element={<Registration />} />
        </Route>
        <Route path="*" element={<NotFound />} />
      </Routes>
    </>
  );
};
